('BE001', 'Burung beo1', 'Gracula religiosa', 'Aves', 'BJ213724', 'Betina', '2013-11-20', 'Burung beo dikenal dengan kemampuan mereka meniru suara manusia dan suara lainnya. Mereka merupakan burung yang cerdas dan sosial, sering kali menjadi hewan peliharaan yang populer karena kemampuan mereka dalam meniru suara serta kecerdasan mereka yang dapat dijejali dengan beberapa trik dan permainan interaktif. Burung beo biasanya memakan biji-bijian, buah-buahan, dan sayuran, serta memerlukan stimulasi mental dan fisik untuk menjaga kesehatan dan kesejahteraannya.', 'Z001', 'BB809'),
('BE002', 'Burung beo2', 'Gracula religiosa', 'Aves', 'BJ213724', 'Jantan', '2012-04-11', 'Burung beo dikenal dengan kemampuan mereka meniru suara manusia dan suara lainnya. Mereka merupakan burung yang cerdas dan sosial, sering kali menjadi hewan peliharaan yang populer karena kemampuan mereka dalam meniru suara serta kecerdasan mereka yang dapat dijejali dengan beberapa trik dan permainan interaktif. Burung beo biasanya memakan biji-bijian, buah-buahan, dan sayuran, serta memerlukan stimulasi mental dan fisik untuk menjaga kesehatan dan kesejahteraannya.', 'Z001', 'BB809'),
