('BU001', 'Buaya1', 'Crocodylus porosus', 'Reptil', 'DG290324', 'jantan', '2008-02-03', 'Buaya Muara merupakan jenis buaya terbesar yang memiliki berat badan sekitar 1 hingga 1,2 ton dengan panjang tubuh 3 sampai 7 meter. Ukuran buaya betina lebih kecil dibanding buaya jantan. Buaya Muara dapat hidup dari 25 sampai 70 tahun. Buaya Muara merupakan jenis buaya terganas, dan terluas persebarannya di dunia dibandingkan dengan jenis buaya lainnya. Tersebar di India, Indonesia, Papua New Guinea, hingga dapat ditemukan di Australia.', 'Z001', 'BA302'),
