('EA001', 'Elang jawa1', 'Nisaetus bartelsi', 'Aves', 'DG290324', 'Jantan', '2013-09-11', 'Elang jawa adalah salah satu spesies elang berukuran sedang dari keluarga Accipitridae dan genus Nisaetus yang endemik di Pulau Jawa. Satwa ini dianggap identik dengan lambang negara Republik Indonesia, yaitu Garuda. Dan sejak 1992, burung ini ditetapkan sebagai maskot satwa langka Indonesia', 'Z001', 'EG034'),
('EA002', 'Elang jawa2', 'Nisaetus bartelsi', 'Aves', 'DG290324', 'Betina', '2013-09-12', 'Elang jawa adalah salah satu spesies elang berukuran sedang dari keluarga Accipitridae dan genus Nisaetus yang endemik di Pulau Jawa. Satwa ini dianggap identik dengan lambang negara Republik Indonesia, yaitu Garuda. Dan sejak 1992, burung ini ditetapkan sebagai maskot satwa langka Indonesia', 'Z001', 'EG034'),
('EA003', 'Elang jawa3', 'Nisaetus bartelsi', 'Aves', 'DG290324', 'Jantan', '2015-10-13', 'Elang jawa adalah salah satu spesies elang berukuran sedang dari keluarga Accipitridae dan genus Nisaetus yang endemik di Pulau Jawa. Satwa ini dianggap identik dengan lambang negara Republik Indonesia, yaitu Garuda. Dan sejak 1992, burung ini ditetapkan sebagai maskot satwa langka Indonesia', 'Z001', 'EG034'),
('FL001', 'Flamingo1', 'Phoenicopterus roseus', 'Aves', 'IK3629', 'Jantan', '2004-12-07', 'Flamingo adalah spesies burung berkaki panjang yang hidup berkelompok. Kata flamingo berasal dari kata Spanyol \'flamengo\', bentuk awal dari \'flamenco\'. Kata-kata ini berasal dari kata Latin flamma, yang berarti \'api\'. Mereka berasal dari genus Phoenicopterus dan familia Phoenicopteridae. Burung ini ditemukan di belahan bumi barat dan timur, tetapi lebih banyak terdapat di belahan timur. Habitat burung ini terdiri dari danau dangkal yang besar, laguna, hutan bakau, dan pulau-pulau berpasir. 4 spesies flamingo di Amerika dan 2 jenis flamingo di Dunia Lama(Eropa, Asia, dan Afrika ).', 'Z001', 'FM095'),
('FL002', 'Flamingo2', 'Phoenicopterus roseus', 'Aves', 'IK3629', 'Betina', '2004-12-03', 'Flamingo adalah spesies burung berkaki panjang yang hidup berkelompok. Kata flamingo berasal dari kata Spanyol \'flamengo\', bentuk awal dari \'flamenco\'. Kata-kata ini berasal dari kata Latin flamma, yang berarti \'api\'. Mereka berasal dari genus Phoenicopterus dan familia Phoenicopteridae. Burung ini ditemukan di belahan bumi barat dan timur, tetapi lebih banyak terdapat di belahan timur. Habitat burung ini terdiri dari danau dangkal yang besar, laguna, hutan bakau, dan pulau-pulau berpasir. 4 spesies flamingo di Amerika dan 2 jenis flamingo di Dunia Lama(Eropa, Asia, dan Afrika ).', 'Z001', 'FM095'),
('GA001', 'Galapagos1', 'Chelonoidis nigra', 'Reptil', 'TT120324', 'Betina', '1983-01-01', 'Kura-kura gal치pagos atau kura-kura raksasa galapagos (Chelonoidis nigra dan spesies terkait) adalah spesies kura-kura terbesar yang masih hidup. Kura-kura gal치pagos modern beratnya bisa mencapai 417 kg (919 pon). Hari ini, kura-kura raksasa hanya ada di dua kepulauan terpencil: Kepulauan Galapagos 1000 km ke arah barat dari daratan Ekuador, dan Aldabra di Samudra Hindia, sekitar 700 km sebelah timur Tanzania.\r\n\r\n', 'Z001', 'GL755'),
('GA002', 'Galapagos2', 'Chelonoidis nigra', 'Reptil', 'TT120324', 'Jantan', '1980-02-02', 'Kura-kura gal치pagos atau kura-kura raksasa galapagos (Chelonoidis nigra dan spesies terkait) adalah spesies kura-kura terbesar yang masih hidup. Kura-kura gal치pagos modern beratnya bisa mencapai 417 kg (919 pon). Hari ini, kura-kura raksasa hanya ada di dua kepulauan terpencil: Kepulauan Galapagos 1000 km ke arah barat dari daratan Ekuador, dan Aldabra di Samudra Hindia, sekitar 700 km sebelah timur Tanzania.\r\n\r\n', 'Z001', 'GL755'),
('GL001', 'Gajah afrika1', 'Loxodonta africana', 'Mamalia', 'TT120324', 'Jantan', '1978-11-11', 'Gajah Afrika adalah mamalia herbivora yang besar, memiliki ciri-ciri khas seperti gading yang panjang pada gajah jantan, telinga besar yang menyerupai benua Afrika, dan hidung yang disebut probosis yang digunakan untuk mengambil makanan dan berkomunikasi. Mereka sering ditemukan di berbagai habitat di Afrika, seperti savana, hutan, dan daerah berhutan.', 'Z001', 'AG250'),
('GL002', 'Gajah afrika2', 'Loxodonta africana', 'Mamalia', 'TT120324', 'Betina', '1978-09-12', 'Gajah Afrika adalah mamalia herbivora yang besar, memiliki ciri-ciri khas seperti gading yang panjang pada gajah jantan, telinga besar yang menyerupai benua Afrika, dan hidung yang disebut probosis yang digunakan untuk mengambil makanan dan berkomunikasi. Mereka sering ditemukan di berbagai habitat di Afrika, seperti savana, hutan, dan daerah berhutan.', 'Z001', 'AG250'),
('GL003', 'Gajah afrika3', 'Loxodonta africana', 'Mamalia', 'TT120324', 'Betina', '1990-03-08', 'Gajah Afrika adalah mamalia herbivora yang besar, memiliki ciri-ciri khas seperti gading yang panjang pada gajah jantan, telinga besar yang menyerupai benua Afrika, dan hidung yang disebut probosis yang digunakan untuk mengambil makanan dan berkomunikasi. Mereka sering ditemukan di berbagai habitat di Afrika, seperti savana, hutan, dan daerah berhutan.', 'Z001', 'AG250'),
('HA001', 'Harimau1', 'Panthera tigris', 'Mamalia', 'DG290324', 'Jantan', '2005-06-09', 'Harimau (Panthera tigris) adalah spesies kucing terbesar yang masih hidup dari genus Panthera. Harimau memiliki ciri loreng yang khas pada bulunya, berupa garis-garis vertikal gelap pada bulu oranye, dengan bulu bagian bawah berwarna putih. Harimau adalah pemangsa puncak, mereka terutama memangsa ungulata seperti rusa dan babi celeng. Harimau adalah hewan teritorial dan umumnya merupakan pemangsa soliter yang penyendiri, tetapi tetap memiliki sisi sosial. Mereka tetap tinggal di area-area yang berdekatan, untuk mendukung kebutuhan makanan dan membesarkan keturunannya. Anak harimau tinggal bersama ibu mereka selama sekitar dua tahun, kemudian akan hidup mandiri dan meninggalkan daerah jelajah ibu mereka untuk membangun rumah mereka sendiri.', 'Z001', 'HR789'),
('HA002', 'Harimau2', 'Panthera tigris', 'Mamalia', 'DG290324', 'betina', '2004-04-07', 'Harimau (Panthera tigris) adalah spesies kucing terbesar yang masih hidup dari genus Panthera. Harimau memiliki ciri loreng yang khas pada bulunya, berupa garis-garis vertikal gelap pada bulu oranye, dengan bulu bagian bawah berwarna putih. Harimau adalah pemangsa puncak, mereka terutama memangsa ungulata seperti rusa dan babi celeng. Harimau adalah hewan teritorial dan umumnya merupakan pemangsa soliter yang penyendiri, tetapi tetap memiliki sisi sosial. Mereka tetap tinggal di area-area yang berdekatan, untuk mendukung kebutuhan makanan dan membesarkan keturunannya. Anak harimau tinggal bersama ibu mereka selama sekitar dua tahun, kemudian akan hidup mandiri dan meninggalkan daerah jelajah ibu mereka untuk membangun rumah mereka sendiri.', 'Z001', 'HR789'),
('HA003', 'Harimau3', 'Panthera tigris', 'Mamalia', 'DG290324', 'Jantan', '2010-09-07', 'Harimau (Panthera tigris) adalah spesies kucing terbesar yang masih hidup dari genus Panthera. Harimau memiliki ciri loreng yang khas pada bulunya, berupa garis-garis vertikal gelap pada bulu oranye, dengan bulu bagian bawah berwarna putih. Harimau adalah pemangsa puncak, mereka terutama memangsa ungulata seperti rusa dan babi celeng. Harimau adalah hewan teritorial dan umumnya merupakan pemangsa soliter yang penyendiri, tetapi tetap memiliki sisi sosial. Mereka tetap tinggal di area-area yang berdekatan, untuk mendukung kebutuhan makanan dan membesarkan keturunannya. Anak harimau tinggal bersama ibu mereka selama sekitar dua tahun, kemudian akan hidup mandiri dan meninggalkan daerah jelajah ibu mereka untuk membangun rumah mereka sendiri.', 'Z001', 'HR789'),
('IG001', 'Iguana1', 'Iguana iguana', 'Reptil', 'SY290373', 'Jantan', '2015-06-08', 'Iguana adalah reptil bersisik yang biasanya memiliki tubuh yang panjang dengan ekor yang kuat. Mereka dikenal dengan warna kulit yang menarik dan cenderung menjadi hewan peliharaan yang populer. Iguana adalah hewan herbivora, sering kali memakan daun, buah-buahan, dan sayuran. Mereka juga memerlukan lingkungan yang hangat dengan paparan sinar matahari yang cukup', 'Z001', 'GU200'),
('IG002', 'Iguana2', 'Iguana iguana', 'Reptil', 'SY290373', 'Betina', '2016-09-07', 'Iguana adalah reptil bersisik yang biasanya memiliki tubuh yang panjang dengan ekor yang kuat. Mereka dikenal dengan warna kulit yang menarik dan cenderung menjadi hewan peliharaan yang populer. Iguana adalah hewan herbivora, sering kali memakan daun, buah-buahan, dan sayuran. Mereka juga memerlukan lingkungan yang hangat dengan paparan sinar matahari yang cukup', 'Z001', 'GU200'),
('IG003', 'Iguana3', 'Iguana iguana', 'Reptil', 'SY290373', 'Jantan', '2018-12-12', 'Iguana adalah reptil bersisik yang biasanya memiliki tubuh yang panjang dengan ekor yang kuat. Mereka dikenal dengan warna kulit yang menarik dan cenderung menjadi hewan peliharaan yang populer. Iguana adalah hewan herbivora, sering kali memakan daun, buah-buahan, dan sayuran. Mereka juga memerlukan lingkungan yang hangat dengan paparan sinar matahari yang cukup', 'Z001', 'GU200'),
('JE001', 'Jerapah1', 'Giraffa camelopardalis', 'Mamalia', 'SY290373', 'Jantan', '2000-03-14', 'Jerapah atau zarafah (nama ilmiah: Giraffa camelopardalis) adalah mamalia berkuku genap endemik Afrika dan merupakan spesies hewan tertinggi yang hidup di darat. Jerapah jantan dapat mencapai tinggi 4,8 sampai 5,5 meter dan memiliki berat yang dapat mencapai 1.360 kilogram. Jerapah betina biasanya sedikit lebih pendek dan lebih ringan.', 'Z001', 'KJ206'),
('JE002', 'Jerapah2', 'Giraffa camelopardalis', 'Mamalia', 'SY290373', 'Betina', '2000-03-14', 'Jerapah atau zarafah (nama ilmiah: Giraffa camelopardalis) adalah mamalia berkuku genap endemik Afrika dan merupakan spesies hewan tertinggi yang hidup di darat. Jerapah jantan dapat mencapai tinggi 4,8 sampai 5,5 meter dan memiliki berat yang dapat mencapai 1.360 kilogram. Jerapah betina biasanya sedikit lebih pendek dan lebih ringan.', 'Z001', 'KJ206'),
('JE003', 'Jerapah3', 'Giraffa camelopardalis', 'Mamalia', 'SY290373', 'Betina', '2004-12-08', 'Jerapah atau zarafah (nama ilmiah: Giraffa camelopardalis) adalah mamalia berkuku genap endemik Afrika dan merupakan spesies hewan tertinggi yang hidup di darat. Jerapah jantan dapat mencapai tinggi 4,8 sampai 5,5 meter dan memiliki berat yang dapat mencapai 1.360 kilogram. Jerapah betina biasanya sedikit lebih pendek dan lebih ringan.', 'Z001', 'KJ206'),
('JE004', 'Jerapah4', 'Giraffa camelopardalis', 'Mamalia', 'SY290373', 'Jantan', '2005-08-07', 'Jerapah atau zarafah (nama ilmiah: Giraffa camelopardalis) adalah mamalia berkuku genap endemik Afrika dan merupakan spesies hewan tertinggi yang hidup di darat. Jerapah jantan dapat mencapai tinggi 4,8 sampai 5,5 meter dan memiliki berat yang dapat mencapai 1.360 kilogram. Jerapah betina biasanya sedikit lebih pendek dan lebih ringan.', 'Z001', 'KJ206'),
('KN001', 'Kuda Nil1', 'Hippopotamus amphibius', 'Mamalia', 'SY290373', 'Betina', '2005-11-18', 'Kuda nil adalah mamalia besar yang memiliki ciri-ciri seperti tubuh yang besar dan berat, kaki pendek, dan mulut lebar yang cocok untuk mengunyah tumbuhan air. Meskipun namanya menyiratkan kesamaan dengan kuda, kuda nil sebenarnya lebih terkait dengan babi air daripada hewan berkuku belah lainnya.\r\n\r\nMereka ditemukan di daerah-daerah perairan di Afrika, terutama di sungai-sungai, danau, dan rawa-rawa. Kuda nil adalah hewan semi-akuatik yang menghabiskan sebagian besar waktunya di air, di mana mereka dapat berenang dengan baik meskipun tubuh mereka berat.', 'Z001', 'KD884'),
('KN002', 'Kuda Nil2', 'Hippopotamus amphibius', 'Mamalia', 'SY290373', 'Jantan', '2005-11-18', 'Kuda nil adalah mamalia besar yang memiliki ciri-ciri seperti tubuh yang besar dan berat, kaki pendek, dan mulut lebar yang cocok untuk mengunyah tumbuhan air. Meskipun namanya menyiratkan kesamaan dengan kuda, kuda nil sebenarnya lebih terkait dengan babi air daripada hewan berkuku belah lainnya.\r\n\r\nMereka ditemukan di daerah-daerah perairan di Afrika, terutama di sungai-sungai, danau, dan rawa-rawa. Kuda nil adalah hewan semi-akuatik yang menghabiskan sebagian besar waktunya di air, di mana mereka dapat berenang dengan baik meskipun tubuh mereka berat.', 'Z001', 'KD884'),
('KO001', 'Komodo1', 'Varanus komodoensis', 'Reptil', 'DG290324', 'Jantan', '1990-12-30', 'Komodo adalah hewan endemik Indonesia, terutama ditemukan di pulau-pulau Komodo, Rinca, Flores, Gili Motang, dan beberapa pulau kecil lainnya. Mereka dikenal dengan ukuran tubuh yang besar, bisa mencapai panjang 2-3 meter dan berat hingga 70-90 kg.\r\n\r\nSifat mereka sebagai pemangsa terkemuka dalam ekosistem mereka sangat menonjol. Mereka adalah karnivora yang kuat, memakan berbagai hewan termasuk mamalia kecil, burung, dan kadang-kadang hewan yang lebih besar seperti rusa atau kerbau. Komodo memiliki kemampuan membunuh dengan menggunakan gigitan mereka yang penuh bakteri beracun, yang dapat membuat mangsa mereka terinfeksi dan lemah sebelum akhirnya menjadi mangsa mereka.', 'Z001', 'MD090'),
('KO002', 'Komodo2', 'Varanus komodoensis', 'Reptil', 'DG290324', 'Betina', '1991-10-27', 'Komodo adalah hewan endemik Indonesia, terutama ditemukan di pulau-pulau Komodo, Rinca, Flores, Gili Motang, dan beberapa pulau kecil lainnya. Mereka dikenal dengan ukuran tubuh yang besar, bisa mencapai panjang 2-3 meter dan berat hingga 70-90 kg.\r\n\r\nSifat mereka sebagai pemangsa terkemuka dalam ekosistem mereka sangat menonjol. Mereka adalah karnivora yang kuat, memakan berbagai hewan termasuk mamalia kecil, burung, dan kadang-kadang hewan yang lebih besar seperti rusa atau kerbau. Komodo memiliki kemampuan membunuh dengan menggunakan gigitan mereka yang penuh bakteri beracun, yang dapat membuat mangsa mereka terinfeksi dan lemah sebelum akhirnya menjadi mangsa mereka.', 'Z001', 'MD090'),
('LU001', 'Lumba-lumba1', 'Delphinus delphis', 'Mamalia', 'IK3629', 'Jantan', '2007-09-19', 'Lumba-lumba adalah mamalia laut yang sangat cerdas, sosial, dan terkenal dengan kemampuan berkomunikasi dan interaksi yang kompleks. Mereka sering ditemukan di perairan hangat dan dingin di seluruh dunia, dan sering menjadi daya tarik dalam aktivitas melihat-lihat satwa liar di laut.', 'Z001', 'LM004'),
('LU002', 'Lumba-lumba2', 'Delphinus delphis', 'Mamalia', 'IK3629', 'Betina', '2008-02-16', 'Lumba-lumba adalah mamalia laut yang sangat cerdas, sosial, dan terkenal dengan kemampuan berkomunikasi dan interaksi yang kompleks. Mereka sering ditemukan di perairan hangat dan dingin di seluruh dunia, dan sering menjadi daya tarik dalam aktivitas melihat-lihat satwa liar di laut.', 'Z001', 'LM004'),
