('ME004', 'Burung Merak4', 'Pavo muticus', 'Aves', 'BJ213724', 'Betina', '2013-12-01', 'Merak dikenal dengan keindahan bulunya yang menakjubkan, terutama yang dimiliki oleh pejantan, dengan bulu-bulu ekor yang panjang dan berwarna-warni yang membentuk kipas indah saat mereka memamerkannya selama musim kawin. Burung merak seringkali dianggap simbol keindahan dan keanggunan.\r\n\r\nMerak biasanya dapat ditemukan di wilayah Asia Tenggara, dan mereka memiliki kecenderungan untuk hidup di daerah yang lebih terbuka seperti padang rumput, savana, atau hutan terbuka. Mereka omnivora, memakan berbagai jenis makanan termasuk biji-bijian, serangga, buah-buahan, dan kadang-kadang reptil kecil atau mamalia kecil.', 'Z001', 'EK985'),
('MT001', 'Macan Tutul1', 'Panthera pardus', 'Mamalia', 'DG290324', 'Jantan', '2004-03-11', 'Macan tutul (bahasa Latin: Panthera pardus) atau Harimau Bintang adalah salah satu dari empat kucing besar. Hewan ini dikenal juga dengan sebutan harimau dahan karena kemampuannya memanjat. Pada mulanya, orang berpikiran bahwa macan tutul adalah hibrida dari singa dan harimau, sehingga muncul nama \"leopard\" di kalangan peneliti Eropa awal.Macan tutul adalah hewan penyendiri, yang saling menghindari satu sama lain. Spesies ini lebih aktif di malam hari. Karena tingkat kematian anak yang tinggi, betina biasanya mempunyai satu sampai dua anak, yang tinggal bersama induknya sampai macan muda berumur sekitar antara satu setengah sampai dua tahun.', 'Z001', 'MU201'),
('MT002', 'Macan Tutul2', 'Panthera pardus', 'Mamalia', 'DG290324', 'Betina', '2003-02-11', 'Macan tutul (bahasa Latin: Panthera pardus) atau Harimau Bintang adalah salah satu dari empat kucing besar. Hewan ini dikenal juga dengan sebutan harimau dahan karena kemampuannya memanjat. Pada mulanya, orang berpikiran bahwa macan tutul adalah hibrida dari singa dan harimau, sehingga muncul nama \"leopard\" di kalangan peneliti Eropa awal.Macan tutul adalah hewan penyendiri, yang saling menghindari satu sama lain. Spesies ini lebih aktif di malam hari. Karena tingkat kematian anak yang tinggi, betina biasanya mempunyai satu sampai dua anak, yang tinggal bersama induknya sampai macan muda berumur sekitar antara satu setengah sampai dua tahun.', 'Z001', 'MU201'),
('MT003', 'Macan Tutul3', 'Panthera pardus', 'Mamalia', 'DG290324', 'Betina', '2006-01-10', 'Macan tutul (bahasa Latin: Panthera pardus) atau Harimau Bintang adalah salah satu dari empat kucing besar. Hewan ini dikenal juga dengan sebutan harimau dahan karena kemampuannya memanjat. Pada mulanya, orang berpikiran bahwa macan tutul adalah hibrida dari singa dan harimau, sehingga muncul nama \"leopard\" di kalangan peneliti Eropa awal.Macan tutul adalah hewan penyendiri, yang saling menghindari satu sama lain. Spesies ini lebih aktif di malam hari. Karena tingkat kematian anak yang tinggi, betina biasanya mempunyai satu sampai dua anak, yang tinggal bersama induknya sampai macan muda berumur sekitar antara satu setengah sampai dua tahun.', 'Z001', 'MU201'),
('OW001', 'Burung hantu1', 'Strigiformes', 'Aves', 'DG290324', 'Jantan', '2010-09-20', 'Burung hantu adalah kelompok burung yang merupakan anggota ordo Strigiformes. Burung ini termasuk golongan burung buas (karnivora, pemakan daging) dan merupakan hewan malam (nokturnal). Seluruhnya, terdapat sekitar 222 spesies yang telah diketahui, yang menyebar di seluruh dunia kecuali Antarktika, sebagian besar Greenland, dan beberapa pulau-pulau terpencil.', 'Z001', 'OL560'),
('OW002', 'Burung hantu2', 'Strigiformes', 'Aves', 'DG290324', 'Betina', '2010-12-09', 'Burung hantu adalah kelompok burung yang merupakan anggota ordo Strigiformes. Burung ini termasuk golongan burung buas (karnivora, pemakan daging) dan merupakan hewan malam (nokturnal). Seluruhnya, terdapat sekitar 222 spesies yang telah diketahui, yang menyebar di seluruh dunia kecuali Antarktika, sebagian besar Greenland, dan beberapa pulau-pulau terpencil.', 'Z001', 'OL560'),
('PA001', 'Panda1', 'Ailuropoda melanoleuca', 'Mamalia', 'TT120324', 'Jantan', '2011-04-27', 'Panda raksasa atau hanya disebut panda, adalah seekor mamalia yang diklasifikasikan ke dalam keluarga beruang, Ursidae, yang merupakan hewan asli Tiongkok Tengah. Panda raksasa tinggal di wilayah pegunungan, seperti Sichuan dan Tibet.', 'Z001', 'PN834'),
('PA002', 'Panda2', 'Ailuropoda melanoleuca', 'Mamalia', 'TT120324', 'Betina', '2011-06-12', 'Panda raksasa atau hanya disebut panda, adalah seekor mamalia yang diklasifikasikan ke dalam keluarga beruang, Ursidae, yang merupakan hewan asli Tiongkok Tengah. Panda raksasa tinggal di wilayah pegunungan, seperti Sichuan dan Tibet.', 'Z001', 'PN834'),
('RP001', 'Red Panda1', 'Ailurus fulgens', 'Mamalia', 'TT120324', 'Betina', '2016-08-20', 'Panda merah (Ailurus fulgens) adalah sejenis binatang menyusui di dalam ordo Carnivora. Sesuai namanya, Panda merah memiliki bulu tebal berwarna merah kecokelatan dan berkaki hitam. Mukanya berbentuk bulat berwarna putih dengan garis merah kecokelatan dari mata ke mulutnya. Buntutnya panjang dengan dua belas cincin merah dan cokelat-muda berselang-seling. Tapak kakinya ditutupi oleh bulu berwarna putih, yang berguna untuk menjaga kehangatan tubuh serta untuk berjalan di atas permukaan salju atau es.', 'Z001', 'PR535'),
('RP002', 'Red Panda2', 'Ailurus fulgens', 'Mamalia', 'TT120324', 'Jantan', '2016-08-16', 'Panda merah (Ailurus fulgens) adalah sejenis binatang menyusui di dalam ordo Carnivora. Sesuai namanya, Panda merah memiliki bulu tebal berwarna merah kecokelatan dan berkaki hitam. Mukanya berbentuk bulat berwarna putih dengan garis merah kecokelatan dari mata ke mulutnya. Buntutnya panjang dengan dua belas cincin merah dan cokelat-muda berselang-seling. Tapak kakinya ditutupi oleh bulu berwarna putih, yang berguna untuk menjaga kehangatan tubuh serta untuk berjalan di atas permukaan salju atau es.', 'Z001', 'PR535'),
('RP003', 'Red Panda3', 'Ailurus fulgens', 'Mamalia', 'TT120324', 'Jantan', '2019-09-19', 'Panda merah (Ailurus fulgens) adalah sejenis binatang menyusui di dalam ordo Carnivora. Sesuai namanya, Panda merah memiliki bulu tebal berwarna merah kecokelatan dan berkaki hitam. Mukanya berbentuk bulat berwarna putih dengan garis merah kecokelatan dari mata ke mulutnya. Buntutnya panjang dengan dua belas cincin merah dan cokelat-muda berselang-seling. Tapak kakinya ditutupi oleh bulu berwarna putih, yang berguna untuk menjaga kehangatan tubuh serta untuk berjalan di atas permukaan salju atau es.', 'Z001', 'PR535'),
('SB001', 'Sanca bulan albino1', 'Python regius', 'Reptil', 'DG290324', 'Jantan', '2009-07-14', 'Sanca bulan albino memiliki penampilan yang menarik dan sering menjadi daya tarik bagi penggemar ular. Kekurangan pigmen dalam tubuh mereka menyebabkan warna kulit yang sangat cerah, yang kontras dengan mata merah atau merah muda yang mencolok. Meskipun memiliki perbedaan warna, mereka memiliki kebutuhan perawatan yang serupa dengan sanca bulan biasa.', 'Z001', 'SA871'),
('SH001', 'Sanca Hijau1', 'Morelia viridis', 'Reptil', 'DG290324', 'Betina', '2009-06-12', 'Sanca hijau biasanya ditemukan di hutan hujan di Papua Nugini, wilayah sekitar Australia, dan pulau-pulau sekitarnya. Mereka memiliki kemampuan memanjat pohon yang baik dan cenderung aktif di malam hari. Karakteristik khas mereka adalah warna hijau yang mencolok pada kulit, dengan variasi warna yang bisa berbeda-beda antara individu satu dengan lainnya.', 'Z001', 'SU450'),
('SL001', 'Singa laut1', 'Otariinae', 'Mamalia', 'IK3629', 'Betina', '2008-03-03', 'Singa laut memiliki ciri-ciri fisik yang membedakannya, seperti tubuh yang ramping, cakar yang kuat, dan kemampuan berenang yang baik. Mereka sering ditemukan di wilayah perairan dingin seperti pantai utara Pasifik dan Antartika. Singa laut adalah hewan yang lincah di air dan umumnya hidup dalam kelompok besar di pantai atau pulau-pulau yang terpencil. Mereka rentan terhadap perubahan lingkungan dan perburuan ilegal, menyebabkan beberapa spesies mereka menjadi terancam punah.', 'Z001', 'SG805'),
('SL002', 'Singa laut2', 'Otariinae', 'Mamalia', 'IK3629', 'Jantan', '2008-02-27', 'Singa laut memiliki ciri-ciri fisik yang membedakannya, seperti tubuh yang ramping, cakar yang kuat, dan kemampuan berenang yang baik. Mereka sering ditemukan di wilayah perairan dingin seperti pantai utara Pasifik dan Antartika. Singa laut adalah hewan yang lincah di air dan umumnya hidup dalam kelompok besar di pantai atau pulau-pulau yang terpencil. Mereka rentan terhadap perubahan lingkungan dan perburuan ilegal, menyebabkan beberapa spesies mereka menjadi terancam punah.', 'Z001', 'SG805'),
('SL003', 'Singa laut3', 'Otariinae', 'Mamalia', 'IK3629', 'Jantan', '2013-10-20', 'Singa laut memiliki ciri-ciri fisik yang membedakannya, seperti tubuh yang ramping, cakar yang kuat, dan kemampuan berenang yang baik. Mereka sering ditemukan di wilayah perairan dingin seperti pantai utara Pasifik dan Antartika. Singa laut adalah hewan yang lincah di air dan umumnya hidup dalam kelompok besar di pantai atau pulau-pulau yang terpencil. Mereka rentan terhadap perubahan lingkungan dan perburuan ilegal, menyebabkan beberapa spesies mereka menjadi terancam punah.', 'Z001', 'SG805'),
('SN001', 'Sanca retikulata', 'Python reticulatus', 'Reptil', 'DG290324', 'Jantan', '2013-02-10', 'Sanca dikenal dengan tubuhnya yang besar, ramping, dan cenderung aktif di malam hari. Mereka adalah predator yang kuat, memangsa mamalia kecil seperti burung, dan kadang-kadang bahkan mamalia yang lebih besar.\r\n\r\nSanca sering ditemukan di berbagai habitat mulai dari hutan hujan hingga sabana dan daerah yang lebih terbuka. Mereka juga sering dipelihara di kebun binatang karena ukuran dan pola warna kulit mereka yang menarik. Meskipun memiliki reputasi sebagai pemangsa yang kuat, sanca yang dipelihara biasanya cenderung jinak dan tidak agresif jika dirawat dengan baik', 'Z001', 'RE926'),
('TP001', 'Tupai pohon1', 'Ptilocercus lowii', 'Mamalia', 'BJ213724', 'Betina', '2017-04-04', 'Tupai memiliki berbagai ukuran dan karakteristik, tetapi umumnya mereka memiliki tubuh kecil, ekor yang panjang, dan cenderung lincah dalam gerakan. Mereka sering menjadi hewan yang lincah dalam mencari makanan, memakan buah-buahan, biji-bijian, serangga, dan nektar.\r\n\r\nTupai juga memiliki peran penting dalam ekosistem, seperti dalam penyerbukan tanaman dan penyebaran biji-bijian. Meskipun kecil, peran mereka dalam ekologi lingkungan mereka sangatlah signifikan.', 'Z001', 'RS788'),
('TP002', 'Tupai pohon2', 'Ptilocercus lowii', 'Mamalia', 'BJ213724', 'Jantan', '2017-05-05', 'Tupai memiliki berbagai ukuran dan karakteristik, tetapi umumnya mereka memiliki tubuh kecil, ekor yang panjang, dan cenderung lincah dalam gerakan. Mereka sering menjadi hewan yang lincah dalam mencari makanan, memakan buah-buahan, biji-bijian, serangga, dan nektar.\r\n\r\nTupai juga memiliki peran penting dalam ekosistem, seperti dalam penyerbukan tanaman dan penyebaran biji-bijian. Meskipun kecil, peran mereka dalam ekologi lingkungan mereka sangatlah signifikan.', 'Z001', 'RS788'),
('ZE001', 'Zebra1', 'Equus quagga', 'Mamalia', 'TT120324', 'Betina', '2003-10-19', 'Zebra adalah mamalia herbivora yang dikenal dengan pola garis-garis hitam putih pada tubuhnya. Mereka biasanya ditemukan di padang rumput Afrika, hidup dalam kawanan besar untuk melindungi diri dari predator. Zebra adalah hewan yang kuat, memiliki kemampuan berlari yang cepat, dan merupakan bagian penting dari ekosistem padang rumput Afrika.', 'Z001', 'ZB776'),
('ZE002', 'Zebra2', 'Equus quagga', 'Mamalia', 'TT120324', 'Jantan', '2003-09-20', 'Zebra adalah mamalia herbivora yang dikenal dengan pola garis-garis hitam putih pada tubuhnya. Mereka biasanya ditemukan di padang rumput Afrika, hidup dalam kawanan besar untuk melindungi diri dari predator. Zebra adalah hewan yang kuat, memiliki kemampuan berlari yang cepat, dan merupakan bagian penting dari ekosistem padang rumput Afrika.', 'Z001', 'ZB776');
